import React from "react";
import "./App.css";
import axios from "axios";
import ExtensionModal from "./ExtensionModal";
import UploadIcon from "./images/uploadIcon.png";

export default class ExtensionsDashboard extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      foundExtensions: [],
    };
    this.fileInput = React.createRef();
  }

  componentDidMount() {
    axios
      .get("http://192.168.1.193:4000/extensions/getExtensions")
      .then((response) => {
        this.setState({ foundExtensions: response.data });
      })
      .catch(function (error) {
        console.log(error);
      });
  }

  sendFile = (e) => {
    e.preventDefault();
    let title = document.getElementById("fileName").value;
    let description = document.getElementById("fileDescription").value;
    if (this.fileInput.current.files[0] && title !== "" && description !== "") {
      // console.log(title, description);
      const formData = new FormData();
      formData.append("file", this.fileInput.current.files[0]);
      formData.append("title", title);
      formData.append("description", description);

      const config = {
        headers: {
          "content-type": "multipart/form-data",
        },
      };

      return axios
        .post(
          "http://192.168.1.193:4000/extensions/addExtensions",
          formData,
          config
        )
        .then((response) => {
          if (response.data === "Failed") {
            alert("An extension with that Title of File Name already exists");
          }
        })
        .catch(function (error) {
          console.log(error);
        });
    } else {
      alert("Please include Name, Description and File");
    }
  };

  addExtensionPressed = (e) => {
    e.preventDefault();
    let darkenScreen = document.getElementById("darkenScreen");
    darkenScreen.style.display = "block";
  };

  fileDropped = (e) => {
    e.preventDefault();

    if (e.dataTransfer.files[0].type === "text/javascript") {
      this.fileInput.current.files = e.dataTransfer.files;
    } else {
      alert("Only Javscript files are accepted");
    }
  };

  preventDefault = (e) => {
    e.preventDefault();
  };

  closeModal = (e) => {
    e.preventDefault();
    let darkenScreen = document.getElementById("darkenScreen");
    darkenScreen.style.display = "none";
  }

  render() {
    return (
      <div id="extensionsDashboard" className="extensionsDashboard">
        <div className="extensionPageHeader">
          <h1 className="extensionPageHeaderTitle">Extensions</h1>
          <h1
            onClick={this.addExtensionPressed}
            className="createExtensionButton"
          >
            Create New Extension
          </h1>
        </div>
        <div className="extensionPageModals">
          {this.state.foundExtensions.map((extension) => {
            return (
              <ExtensionModal
                key={`extensionModal_${extension._id}`}
                name={extension.name}
                description={extension.description}
              />
            );
          })}
        </div>
        <div id="darkenScreen">
          <div className="closeModal" onClick={this.closeModal}></div>
          <div className="extensionUploadModal">
            <form className="addAnExtension" onSubmit={this.sendFile}>
              <h1 className="addAnExtensionTitle">Add An Extension</h1>
              <input
                type="text"
                id="fileName"
                name="fileName"
                placeholder="Extensions Name"
              />
              <h1 className="extensionDescription">Extension Description</h1>
              <textarea id="fileDescription" name="fileDescription" placeholder="This extension allows the users to ..." />
              <div
                onDragOver={this.preventDefault}
                onDrop={this.fileDropped}
                id="fileInputDrop"
                className="fileInputDrop"
              >
                <img src={UploadIcon} />
                <div className="fileInputDropContainer">
                  <h1>Drag file here to upload or </h1>
                  <input
                    ref={this.fileInput}
                    accept=".js"
                    type="file"
                    id="fileInput"
                    name="fileInput"
                    placeholder="browse"
                  />
                </div>
              </div>
              <input
                id="uploadExtensionButton"
                type="submit"
                value="Upload Extensions"
              />
            </form>
            <div className="createAnExtension">
              <h1 className="addAnExtensionTitle">Create An Extension</h1>
              {/* the following code is the docmuntation pdf in base64 form */}
              <a className="downloadDoc" href="data:application/pdf;base64," download="ExtensionDocumentation.pdf">Download Documentation</a>
              <br />
              <a className="downloadSimple" href="data:text/javascript;charset=utf-8;base64," download="SimpleExtensionTemplate.js">Download Simple Template</a>
              <h1 className="exampleSimpleTemplateHeader">Example: SimpleTemplate.js</h1>
              <div className="exampleSimpleTemplate">
                <p className="exampleImport">
                  import {"{"} React, socketSendState, socketGetState {"}"} from
                  "./ExtensionLibrary";
                </p>
                <p>
                  export default class SimpleTemplate extends React.Component {"{"}
                  <br />
                  &nbsp; &nbsp;  &nbsp; &nbsp;constructor(props) {"{"}
                  <br />
                  &nbsp; &nbsp;  &nbsp; &nbsp;  &nbsp; &nbsp;  &nbsp; &nbsp; super(props);
                  <br />
                  &nbsp; &nbsp;  &nbsp; &nbsp;  &nbsp; &nbsp;  &nbsp; &nbsp; this.state = {"{"}
                  {"}"};<br />  &nbsp; &nbsp;  &nbsp; &nbsp; {"}"}
                </p>
                <p>
                  &nbsp; &nbsp; &nbsp; &nbsp; componentDidMount() {"{"}
                  {"}"}
                </p>
                <p>
                  &nbsp; &nbsp; &nbsp; &nbsp; render() {"{"}
                  <br />
                  &nbsp; &nbsp;  &nbsp; &nbsp;  &nbsp; &nbsp;  &nbsp; &nbsp; const divStyle = {"{"} width: '100%', height: '100%', overflow:
                  'hidden' {"}"};
                </p>
                <p>
                  &nbsp; &nbsp; &nbsp; &nbsp;  &nbsp; &nbsp;  &nbsp; &nbsp; return (<br /> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;div key="simpleTemplate" style={"{"}divStyle{"}"}{" "}
                  id="simpleTemplate&gt;&lt;/div&gt;
                  <br /> &nbsp; &nbsp;  &nbsp; &nbsp;  &nbsp; &nbsp;  &nbsp; &nbsp; )<br /> &nbsp; &nbsp;  &nbsp; &nbsp; {"}"}
                </p>
                <p>{"}"}</p>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
